      //   <img src={green} alt="green shoe" className="shoe" color="green" />
      //   <img src={orange} alt="orange shoe" className="shoe" color="orange" />
      //   <img src={black} alt="black shoe" className="shoe " color="black" /> */}
      //   </Fragment>
      // </AwesomeSlider>
      <div>
      <SimpleImageSlider
        width={400}
        height={504}
        images={images}
        showBullets={true}
        showNavs={true}
      />
    </div>
    
  );
};

export default ProductImages;
